(622759, 1777, 15768, 601, NULL, '2017-12-04 14:59:26', '{\"source_lang\":\"py\",\"original_name\":\"b.py\",\"source_content\":\"def zig(a,b,c,d):\\r\\n    e = []\\r\\n    if b == \\\"FL\\\":\\r\\n        for i in range(a):\\r\\n            if i%2 == 0:\\r\\n                e.append(c[i])\\r\\n            elif i%2 == 1:\\r\\n                e.append(d[i])\\r\\n    elif b == \\\"FR\\\":\\r\\n        for i in range(a):\\r\\n            if i%2 == 1:\\r\\n                e.append(c[i])\\r\\n            elif i%2 == 0:\\r\\n                e.append(d[i])\\r\\n    elif b == \\\"BL\\\":\\r\\n        for i in range(a-1,-1,-1):\\r\\n            if a == 1:\\r\\n                e.append(c[i])\\r\\n            elif i%2 == 1:\\r\\n                e.append(c[i])\\r\\n            elif i%2 == 0:\\r\\n                e.append(d[i])\\r\\n    elif b == \\\"BR\\\":\\r\\n        for i in range(a-1,-1,-1):\\r\\n            if a == 1:\\r\\n                e.append(d[i])\\r\\n            elif i%2 == 0:\\r\\n                e.append(c[i])\\r\\n            elif i%2 == 1:\\r\\n                e.append(d[i])\\r\\n    return e\\r\\n\\r\\ndef sum(list):\\r\\n    if len(list) == 1:\\r\\n        return str(list[0])\\r\\n    else:\\r\\n        return str(list[0])+\\\" \\\"+sum(list[1:])\\r\\n\\r\\na = int(input())\\r\\nc = []\\r\\nd = []\\r\\nfor i in range(a):\\r\\n    x,y = map(int, input().split())\\r\\n    c.append(x)\\r\\n    d.append(y)\\r\\n\\r\\nb = input()\\r\\nprint(sum(zig(a,b,c,d)))\\r\\n\"}', '2017-12-04 14:59:27', '{\"verdict\":\"Wrong Answer\",\"output\":\"Testcase #1\\tin : 1.in out: 1.out\\n\\tOK (0.036 sec real, 0.036 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #2\\tin : 2.in out: 2.out\\n\\tOK (0.036 sec real, 0.037 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #3\\tin : 3.in out: 3.out\\n\\tOK (0.032 sec real, 0.036 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #4\\tin : 4.in out: 4.out\\n\\tOK (0.048 sec real, 0.051 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #5\\tin : 5