(623170, 1777, 15768, 601, NULL, '2017-12-05 14:07:03', '{\"source_lang\":\"py\",\"original_name\":\"asd.py\",\"source_content\":\"def zig(a,b,c,d):   #untuk menentukan lompatannya\\r\\n    e = []\\r\\n    if b == \\\"FL\\\":\\r\\n        for i in range(a):\\r\\n            if i%2 == 0:\\r\\n                e.append(c[i])\\r\\n            elif i%2 == 1:\\r\\n                e.append(d[i])\\r\\n    elif b == \\\"FR\\\":\\r\\n        for i in range(a):\\r\\n            if i%2 == 1:\\r\\n                e.append(c[i])\\r\\n            elif i%2 == 0:\\r\\n                e.append(d[i])\\r\\n    elif b == \\\"BL\\\":\\r\\n        if a%2 == 0:\\r\\n            for i in range(a-1,-1,-1):\\r\\n                if i%2 == 1:\\r\\n                    e.append(c[i])\\r\\n                elif i%2 == 0:\\r\\n                    e.append(d[i])\\r\\n        else:\\r\\n            for i in range(a-1,-1,-1):\\r\\n                if i%2 == 0:\\r\\n                    e.append(c[i])\\r\\n                elif i%2 == 1:\\r\\n                    e.append(d[i])\\r\\n    elif b == \\\"BR\\\":\\r\\n        if a%2 == 0:\\r\\n            for i in range(a-1,-1,-1):\\r\\n                if i%2 == 0:\\r\\n                    e.append(c[i])\\r\\n                elif i%2 == 1:\\r\\n                    e.append(d[i])\\r\\n        else:\\r\\n            for i in range(a-1,-1,-1):\\r\\n                if i%2 == 1:\\r\\n                    e.append(c[i])\\r\\n                elif i%2 == 0:\\r\\n                    e.append(d[i])\\r\\n\\r\\n    return e\\r\\n\\r\\ndef sum(list):   #merubah list ke angka\\r\\n    if len(list) == 1:\\r\\n        return str(list[0])\\r\\n    else:\\r\\n        return str(list[0])+\\\" \\\"+sum(list[1:])\\r\\n\\r\\na = int(input())   #menentukan banyaknya baris angka\\r\\nc = []\\r\\nd = []\\r\\nfor i in range(a):   #menyimpan input angka ke list c dan d\\r\\n    x,y = map(int, input().split())\\r\\n    c.append(x)\\r\\n    d.append(y)\\r\\n\\r\\nb = input()\\r\\nprint(sum(zig(a,b,c,d)))\\r\\n\\r\\n\"}', '2017-12-05 14:07:09', '{\"verdict\":\"Accepted\",\"output\":\"Testcase #1\\tin : 1.in out: 1.out\\n\\tOK (0.044 sec real, 0.045 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #2\\tin : 2.in out: 2.out\\n\\tOK (0.036 sec real, 0.036 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #3\\tin : 3.in out: 3.out\\n\\tOK (0.040 sec real, 0.040 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #4\\tin : 4.in out: 4.out\\n\\tOK (0.036 sec real, 0.039 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #5\\tin : 5.in out: 5.out\\n\\tOK (0.036 sec real, 0.037 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #6\\tin : 6.in out: 6.out\\n\\tOK (0.044 sec real, 0.048 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #7\\tin : 7.in out: 7.out\\n\\tOK (0.044 sec real, 0.044 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #8\\tin : 8.in out: 8.out\\n\\tOK (0.036 sec real, 0.037 sec wall, 0 syscalls)\\n\\tAccepted\\n\",\"total_testcase\":8,\"right_testcase\":8}', NULL, 3, 'Accepted', 100, '', NULL);
