(623175, 1777, 15750, 601, NULL, '2017-12-05 18:51:59', '{\"source_lang\":\"py\",\"original_name\":\"zig zag.py\",\"source_content\":\"n = int(input())\\r\\nisi = []\\r\\nfor i in range(n):\\r\\n    isi.append(input().split())\\r\\ntipe = input()\\r\\nif tipe[0] == \'F\':\\r\\n    for j in range(n):\\r\\n        if tipe[1] == \'L\':   #Untuk FL\\r\\n            if j != n-1:     #Bukan di akhir, tidak ada newline\\r\\n                if j % 2:\\r\\n                    print(isi[j][1],\'\', end = \'\')\\r\\n                else:\\r\\n                    print(isi[j][0],\'\', end = \'\')\\r\\n            else:         # Diakhir, ada newline\\r\\n                if j % 2:\\r\\n                    print(isi[j][1])\\r\\n                else:\\r\\n                    print(isi[j][0])\\r\\n        else:    #Untuk FR\\r\\n            if j != n-1:\\r\\n                if j % 2:\\r\\n                    print(isi[j][0],\'\',end = \'\')\\r\\n                else:\\r\\n                    print(isi[j][1],\'\',end = \'\')\\r\\n            else:\\r\\n                if j % 2:\\r\\n                    print(isi[j][0])\\r\\n                else:\\r\\n                    print(isi[j][1])\\r\\nelse:\\r\\n    for j in range(n,0,-1):        # Untuk Backward\\r\\n        if tipe[1] == \'L\':             #BL\\r\\n            if n % 2:                   #Jika n ganjil\\r\\n                if j != 1:\\r\\n                    if j % 2:\\r\\n                        print(isi[j-1][0],\'\',end = \'\')\\r\\n                    else:\\r\\n                        print(isi[j-1][1],\'\',end = \'\')\\r\\n                else:\\r\\n                    if j % 2:\\r\\n                        print(isi[j-1][0])\\r\\n                    else:\\r\\n                        print(isi[j-1][1])\\r\\n            else:                       #n genap\\r\\n                if j != 1:\\r\\n                    if j % 2:\\r\\n                        print(isi[j-1][1],\'\',end = \'\')\\r\\n                    else:\\r\\n                        print(isi[j-1][0],\'\',end = \'\')\\r\\n                else:\\r\\n                    if j % 2:\\r\\n                        print(isi[j-1][1])\\r\\n                    else:\\r\\n                        print(isi[j-1][0])\\r\\n        else:                   #BR\\r\\n            if n % 2:           #n ganjil\\r\\n                if j != 1:\\r\\n                    if j % 2:\\r\\n                        print(isi[j-1][1], \'\', end = \'\')\\r\\n                    else:\\r\\n                        print(isi[j-1][0], \'\',end = \'\')\\r\\n                else:\\r\\n                    if j % 2:\\r\\n                        print(isi[j-1][1])\\r\\n                    else:\\r\\n                        print(isi[j-1][0])\\r\\n            else:               #n genap\\r\\n                if j != 1:\\r\\n                    if j % 2:\\r\\n                        print(isi[j-1][0], \'\', end = \'\')\\r\\n                    else:\\r\\n                        print(isi[j-1][1], \'\',end = \'\')\\r\\n                else:\\r\\n                    if j % 2:\\r\\n                        print(isi[j-1][0])\\r\\n                    else:\\r\\n                        print(isi[j-1][1])\\r\\n\\r\\n\"}', '2017-12-05 18:52:05', '{\"verdict\":\"Accepted\",\"output\":\"Testcase #1\\tin : 1.in out: 1.out\\n\\tOK (0.040 sec real, 0.041 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #2\\tin : 2.in out: 2.out\\n\\tOK (0.032 sec real, 0.035 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #3\\tin : 3.in out: 3.out\\n\\tOK (0.044 sec real, 0.044 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #4\\tin : 4.in out: 4.out\\n\\tOK (0.040 sec real, 0.040 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #5\\tin : 5.in out: 5.out\\n\\tOK (0.036 sec real, 0.038 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #6\\tin : 6.in out: 6.out\\n\\tOK (0.040 sec real, 0.040 sec wall, 0 syscalls)\\n\\tAccepted\\nTestcase #7\\tin : 7.in out: 7.out\\n\\tOK (0.040 sec real, 0.044 sec wall,